gn1(){return A.al("L\u2019Ambassadeur de la R\xe9publique d\u2019Ha\xefti au Japon, M. Helph Monod HONORAT, a pris part, les 20 et 22 juin 2022, \xe0 une rencontre de haut niveau organis\xe9e par le Ministre des Affaires \xc9trang\xe8res du Japon, S.E.M.  Yoshimasa HAYASHI, avec les chefs de mission du groupe des Pays Latino-am\xe9ricains et Carib\xe9ens (GRULAC). Cette initiative s\u2019inscrit dans l\u2019objectif de pr\xe9senter l\u2019agenda diplomatique du Japon aux missions des pays de l\u2019Am\xe9rique Latine et de la Cara\xefbe pour l\u2019ann\xe9e fiscale 2022-2023. ",null," TEXTE R\xc9UNION DU GRULAC",null,null)},
