gn3(){return A.al("Horaires d\u2019accueil\n\n\n\nLa Section consulaire de l'Ambassade de la R\xe9publique d'Ha\xefti au Japon vous accueille avec dynamisme du lundi au vendredi, de 9h00 \xe0 16h00.\n\nBas\xe9e \xe0 Tokyo, notre Section consulaire exerce ses comp\xe9tences sur l'ensemble du territoire japonais.\n\nPour les r\xe9sidents dans des pays \xe9chappant \xe0 la juridiction du Service consulaire de l'Ambassade d'Ha\xefti \xe0 TOKYO, nous vous invitons instamment \xe0 contacter l'Ambassade Ha\xeftienne d\xe9l\xe9gu\xe9e \xe0 votre r\xe9gion pour toute assistance.\n\n\n\nLes passeports sont d\xe9livr\xe9s aux demandeurs ha\xeftiens sur pr\xe9sentation d'un document d'identit\xe9 et d'une preuve de citoyennet\xe9 ha\xeftienne (passeport, carte d'identification personnelle). \xc0 cette fin, les demandeurs doivent :\n\n\n\n- Remplir et signer un formulaire de demande de passeport ;\n\n- Soumettre les documents suivants au Service consulaire de l'Ambassade ou au Consulat g\xe9n\xe9ral autoris\xe9 \xe0 vous servir :\n\n1. Un acte de naissance d\xe9livr\xe9 par les Archives nationales ha\xeftiennes (nouveau certificat bleu et rouge) ;\n\n2. L'ancien passeport et une deuxi\xe8me pi\xe8ce d'identification valide (permis de conduire, carte d'\xe9tudiant ou carte de r\xe9sident) ;\n\n3. Deux pi\xe8ces d'identification valides si l'ancien passeport n'est pas disponible ;\n\n4. Deux photos r\xe9centes de passeport sur fond blanc, datant de moins de trois (3) mois ;\n\n5. Un extrait ou l'acte de mariage original, si la demanderesse est une femme mari\xe9e souhaitant changer de nom ;\n\n6. L'acte de divorce original, si la demanderesse est divorc\xe9e et souhaite changer de nom ;\n\n7. L'acte de d\xe9c\xe8s du mari si la demanderesse est veuve et souhaite changer de nom ;\n\n8. Une autorisation parentale sign\xe9e par un parent ou tuteur l\xe9gal, si la demande est d\xe9pos\xe9e au nom d'un mineur.\n\n\n\nVeuillez noter : les passeports sont d\xe9livr\xe9s pour une p\xe9riode de dix (10) ans pour les adultes et de cinq (5) ans pour les mineurs (moins de 18 ans) ; aucune modification n'est autoris\xe9e pendant cette p\xe9riode. Toute modification de donn\xe9es sur un passeport d\xe9livr\xe9 doit \xeatre effectu\xe9e sur la base d'une nouvelle demande d\xfbment pay\xe9e. En cas de perte d'un passeport valide, le demandeur doit soumettre un rapport de police avec le formulaire de demande.\n\n\n\nRemarque : dans certains cas d'extr\xeame urgence, un certificat de voyage ou une feuille de route peut \xeatre d\xe9livr\xe9 en lieu et place d'un passeport pour faciliter le voyage des ressortissants ha\xeftiens vers Ha\xefti. Cette feuille de route est valable pour une (1) mois et un (1) seul voyage. Il faut comprendre que les ressortissants ha\xeftiens ne pourront pas retourner au Japon avec ce document de voyage. Vous devez avoir votre passeport.\n\n\n\nFrais de passeport : Veuillez consulter nos tarifs.\n\n\n\nNous acceptons les principales cartes de cr\xe9dit ou de d\xe9bit (Visa et Mastercard), les mandats, les ch\xe8ques certifi\xe9s ou les ch\xe8ques de caisse \xe0 l'ordre de l'Ambassade d'Ha\xefti au Japon.",null,"DEMANDE DE PASSEPORT",null,null)},
gn4(){return A.al("D\u2019une mani\xe8re g\xe9n\xe9rale, les touristes voyageant en Ha\xefti n\u2019ont pas besoin de visa d\u2019entr\xe9e. Leurs passeports doivent \xeatre valides pour 6 mois au moins et ils doivent s\u2019acquitter d\u2019une taxe de US10.00 \xe0 leur arriv\xe9e \xe0 l\u2019a\xe9roport.Cependant, les ressortissants des pays suivants ont besoin d\u2019un visa pour entrer en Ha\xefti : R\xe9publique Dominicaine, Panama, Colombie, Cuba, Syrie, Libye, Iran, Vietnam et Y\xe9men.\n\nLes ressortissants de ces 9 pays susmentionn\xe9s (R\xe9publique Dominicaine, Panama, Colombie, Cuba, Syrie, Libye, Iran et Vietnam) qui ont besoin d\u2019un visa doivent en faire la demande au moins un (1) mois avant la date de leur d\xe9part et fournir les documents justificatifs suivants :\n\n\n-\tFormulaire de demande de visa d\xfbment compl\xe9t\xe9 et sign\xe9 ;\n\n-\tDeux (2) photos passeport r\xe9centes en couleur ;\n\n\n-\tLettre expliquant la raison et la dur\xe9e du s\xe9jour, et fournissant les informations suivantes :\n\n\n1. Nom, adresse et t\xe9l\xe9phone de l\u2019h\xf4tel ou de la maison priv\xe9e o\xf9 elles vont habiter pendant leur s\xe9jour en Ha\xefti ;\n\n2. Passeport en cours de validit\xe9 (au moins pour 6 mois) ;\n\n3. Photocopie de la confirmation de r\xe9servation d\u2019avion ou du billet aller-retour ; et\n\n4. Lettre de l\u2019actuel employeur\n\n\nLes frais\xa0doivent \xeatre pay\xe9s par mandat, ch\xe8que certifi\xe9 ou ch\xe8que de banque \xe0 l\u2019ordre de \xab Embassy of Haiti in Washington \xbb.",null,"VISA TOURISTIQUE",null,null)},
gn5(){return A.al("Les visas diplomatiques et officiels sont d\xe9livr\xe9s sur les passeports diplomatiques ou officiels et sur les laissez-passer des Nations Unies, \xe0 la demande de l'institution pour laquelle le demandeur travaille.\n\nLes documents suivants sont requis pour la d\xe9livrance d'un visa diplomatique ou officiel :\n\nLettre de demande de visa de l'institution comp\xe9tente \n\nPasseport valide \n\nDeux (2) photos de passeport en couleur.",null,"VISA DIPLOMATIQUE & OFFICIEL",null,null)},
