gmv(){return A.al("Nationalit\xe9 :\n\nNom : Ha\xeftien(s)\n\nAdjectif : Ha\xeftien\n\n\n\nGroupes ethniques :\n\nNoir : 95 %, Mul\xe2tre et Blanc : 5 %\n\n\n\nLangues :\n\nFran\xe7ais (officiel), Cr\xe9ole (officiel)\n\n\n\nReligions :\n\nCatholique romaine : 80 %, Protestant : 16 % (Baptiste 10 %, Pentec\xf4tiste 4 %, Adventiste 1 %, autre 1 %), Aucune : 1 %, Autre : 3 %\n\n\n\nPopulation :\n\n9 801 664 (estimation de juillet 2012)\n\nComparaison avec le monde : 88\n\nRemarque : Les estimations pour ce pays prennent explicitement en compte les effets de la mortalit\xe9 excessive due au SIDA ; cela peut entra\xeener une esp\xe9rance de vie plus faible, une mortalit\xe9 infantile plus \xe9lev\xe9e, des taux de mortalit\xe9 plus \xe9lev\xe9s, des taux de croissance de la population plus faibles et des changements dans la distribution de la population par \xe2ge et par sexe par rapport \xe0 ce qui serait autrement attendu.\n\n\n\nStructure par \xe2ge :\n\n0-14 ans : 35,3 % (1 732 645 hommes/femmes 1 725 313)\n\n15-64 ans : 60,7 % (2 953 603 hommes/femmes 2 998 528)\n\n65 ans et plus : 4 % (174 483 hommes/femmes 217 092) (estimation de 2012)\n\n\n\n\xc2ge m\xe9dian :\n\nTotal : 21,6 ans\n\nHomme : 21,4 ans\n\nFemme : 21,9 ans (estimation de 2012)\n\n\n\nTaux de croissance de la population :\n\n0,888\n\nComparaison avec le monde : 127\n\nRemarque : Les chiffres pr\xe9liminaires de 2011 diff\xe8rent consid\xe9rablement de ceux de 2010, qui ont \xe9t\xe9 fortement influenc\xe9s par l'effet d\xe9mographique du s\xe9isme de janvier 2010 ; les derniers chiffres correspondent davantage \xe0 ceux de 2009 (estimation de 2012)\n\n\n\nTaux de natalit\xe9 :\n\n23,87 naissances/1 000 habitants (estimation de 2012)\n\nComparaison avec le monde : 68\n\n\n\nTaux de mortalit\xe9 :\n\n8,1 d\xe9c\xe8s/1 000 habitants\n\nComparaison avec le monde : 94\n\nRemarque : Les chiffres pr\xe9liminaires de 2011 diff\xe8rent consid\xe9rablement de ceux de 2010, qui ont \xe9t\xe9 fortement influenc\xe9s par l'effet d\xe9mographique du s\xe9isme de janvier 2010 ; les derniers chiffres correspondent davantage \xe0 ceux de 2009 (estimation de juillet 2012)\n\n\n\nTaux de migration nette :\n\n-6,9 migrant(s)/1 000 habitants (estimation de 2012)\n\nComparaison avec le monde : 201\n\nUrbanisation :\n\nPopulation urbaine : 52 % de la population totale (2010)\n\nTaux d'urbanisation : Taux de changement annuel de 3,9 % (2010-15, estimation)\n\n\n\nPrincipales villes \u2013 population :\n\nPORT-AU-PRINCE (capitale) 2,143 millions (2010)\n\n\n\nRatio des sexes :\n\n\xc0 la naissance : 1,01 homme/femme\n\nMoins de 15 ans : 1 homme/femme\n\n15-64 ans : 0,98 homme/femme\n\n65 ans et plus : 0,8 homme/femme\n\nPopulation totale : 0,98 homme/femme (estimation de 2011)\n\n\n\nTaux de mortalit\xe9 maternelle :\n\n350 d\xe9c\xe8s/100 000 naissances vivantes (2010)\n\nComparaison avec le monde : 33\n\n\n\nTaux de mortalit\xe9 infantile :\n\nTotal : 52,44 d\xe9c\xe8s/1 000 naissances vivantes\n\nComparaison avec le monde : 42\n\nHomme : 56,47 d\xe9c\xe8s/1 000 naissances vivantes\n\nFemme : 48,37 d\xe9c\xe8s/1 000 naissances vivantes\n\nRemarque : Les chiffres pr\xe9liminaires de 2011 diff\xe8rent consid\xe9rablement de ceux de 2010, qui ont \xe9t\xe9 fortement influenc\xe9s par l'effet d\xe9mographique du s\xe9isme de janvier 2010 ; les derniers chiffres correspondent davantage \xe0 ceux de 2009 (estimation de 2012)\n\n\n\nEsp\xe9rance de vie \xe0 la naissance :\n\nPopulation totale : 62,51 ans\n\nComparaison avec le monde : 184\n\nHomme : 61,15 ans\n\nFemme : 63,89 ans\n\n\n\nTaux de f\xe9condit\xe9 total :\n\n2,98 enfants/femme (estimation de 2012)\n\nComparaison avec le monde : 63\n\n\n\nD\xe9penses de sant\xe9 :\n\n6 % du PIB (2009)\n\nComparaison avec le monde : 105\n\n\n\nDensit\xe9 des m\xe9decins :\n\n0,25 m\xe9decin(s)/1 000 habitants (1998)\n\n\n\nDensit\xe9 des lits d'h\xf4pital :\n\n1,3 lits/1 000 habitants (2007)\n\n\n\nVIH/SIDA \u2013 Taux de pr\xe9valence chez les adultes :\n\n1,9 % (estimation de 2009)\n\nComparaison avec le monde : 31\n\n\n\nVIH/SIDA \u2013 Personnes vivant avec le VIH/SIDA\n\n120 000 (estimation de 2009)\n\nComparaison avec le monde : 37\n\n\n\nVIH/SIDA \u2013 D\xe9c\xe8s :\n\n7 100 (estimation de 2009)\n\nComparaison avec le monde : 29\n\n\n\nPrincipales maladies infectieuses :\n\nNiveau de risque : \xe9lev\xe9\n\nMaladies d'origine alimentaire ou hydrique : diarrh\xe9e bact\xe9rienne et protozoaire, h\xe9patite A et B, et fi\xe8vre typho\xefde Maladies \xe0 transmission vectorielle : dengue et paludisme\n\nMaladie li\xe9e \xe0 l'eau : leptospirose (2009)\n\n\n\nEnfants de moins de 5 ans en sous-poids :\n\n18,9 % (2006)\n\nComparaison avec le monde : 39\n\n\n\nD\xe9penses d'\xe9ducation :\n\nND\n\n\n\nAlphab\xe9tisation :\n\nD\xe9finition : 15 ans et plus peuvent lire et \xe9crire\n\nPopulation totale : 52,9 %\n\nHomme : 54,8 %\n\nFemme : 51,2 % (estimation de 2003)```",null,"haitienbref",null,null)},
gmq(){return A.al("Selon l'article 3 de la Constitution de 1987 :\n\nL'embl\xe8me de la Nation ha\xeftienne est un drapeau ainsi d\xe9crit :\n\nDeux (2) bandes horizontales de dimensions \xe9gales : l'une bleue en haut, symbolisant l'immensit\xe9 du ciel, et l'une rouge en bas, repr\xe9sentant le courage et la r\xe9silience du peuple ;\n\n Au centre, sur un fond blanc immacul\xe9 signifiant la qu\xeate de justice et d'unit\xe9, est fi\xe8rement emblasonn\xe9 le blason de la R\xe9publique ;\n\nLe blason de la R\xe9publique se dresse majestueusement avec un palmier, symbole de triomphe et de victoire, surmont\xe9 du bonnet de la libert\xe9, embl\xe8me de la libert\xe9. Au pied des palmes imposantes repose un troph\xe9e orn\xe9 de la devise retentissante : L'Union Fait La Force, refl\xe9tant la puissance collective et la solidarit\xe9 du peuple ha\xeftien.",null,"haitienbref",null,null)},
