gn0(){return"On Friday, March 25, 2022, in a convivial atmosphere, the Embassy of the Republic of Haiti in Japan organized the screening of the film 'Governors of the Dew' as part of the Francophonie Month. On this beautiful celebration evening, Haitian culture (art, crafts, music, and gastronomy) was showcased."},
gn1(){return"The Ambassador of the Republic of Haiti to Japan, Mr. Helph Monod HONORAT, participated on June 20 and 22, 2022, in a high-level meeting organized by the Minister of Foreign Affairs of Japan, H.E. Yoshimasa HAYASHI, with the heads of mission from the Group of Latin American and Caribbean Countries (GRULAC). This initiative aims to present Japan's diplomatic agenda to the missions of the countries of Latin America and the Caribbean for the fiscal year 2022-2023."},
gn2(){return"The Embassy of Haiti in Japan received, on August 16, 2022, a visit from students from the after-school care program 'Kids Forest.' The Mission had a wonderful day interacting with the students and teachers of Kids Forest. The group, thirteen students aged between 7 and 10, and four teachers, arrived at the Embassy in the afternoon. A presentation on Haitian history, culture, and traditions took place in the conference room, followed by a guided tour of the Mission's premises before bidding farewell."},
gmJ(){return"Read More"},
gon(){return"On Friday, March 25, 2022, in a friendly atmosphere, the Embassy of the Republic of Haiti in Japan organized the screening of the film 'Governors of the Dew' as part of the 'Month of Francophonie.'\n\n During this beautiful celebration evening, Haitian culture (art, crafts, music, and gastronomy) was highlighted."},
goo(){return"The Ambassador of the Republic of Haiti to Japan, Mr. Helph Monod HONORAT, participated on June 20 and 22, 2022, in a high-level meeting organized by the Minister of Foreign Affairs of Japan, Mr. Yoshimasa HAYASHI, with the heads of mission of the Group of Latin American and Caribbean Countries (GRULAC).\n\n This initiative aims to present Japan's diplomatic agenda to the missions of the countries of Latin America and the Caribbean for the fiscal year 2022-2023. Minister HAYASHI, accompanied by the Director-General for the Latin America and Caribbean region, Ambassador Maki KOBAYASHI, took the opportunity to thank the Latin American and Caribbean countries for their support following Japan's election to the United Nations Security Council as a non-permanent member during the period 2023-2024.\n\nHe renewed the commitment and readiness of the Japanese government to continue and strengthen its efforts to support Latin American and Caribbean countries through technical cooperation projects, the dispatch of experts, and financing for development. He also emphasized the importance of GRULAC to Japan, which brings together important partners with whom Japan shares fundamental values such as democracy and human rights.\n\n Ambassador HONORAT, in his speech, took the opportunity to highlight the effectiveness of Japanese cooperation in Haiti while expressing, on behalf of the Haitian government, words of gratitude for Japan's particular interest in Haiti. He also expressed his wish to see Japanese cooperation include, in the near future, investments related to culture, science, innovation, and technology that can contribute to the modernization of Haiti's infrastructure and sustainable development.\n\n The ambassador also noted that Japan's support will always be very useful to Caribbean countries in addressing issues related to climate change and natural disasters."},
gop(){return"On August 16, 2022, the Embassy of Haiti in Japan received a visit from students of the after-school program 'Kids Forest.'\n\n The Mission had a beautiful day of interaction with the students and teachers of Kids Forest. The group, thirteen students aged between 7 and 10, and four teachers, arrived at the Embassy in the afternoon. A presentation session on Haitian history, culture, and traditions took place in the conference room, and then the group conducted a guided tour of the Mission's premises before bidding farewell. \n\n This visit is part of the Mission's objective to promote the cultural and historical richness of Haiti to young Japanese. Indeed, these opportunities for exchange and sharing allow young people to discover other cultures and broaden their horizons on the world."},
