gn3(){return"The Consular Section of the Embassy of the Republic of Haiti in Japan warmly welcomes you from Monday to Friday, from 9:00 a.m. to 4:00 p.m.\n\n\n\n Based in Tokyo, our Consular Section has jurisdiction over the entire Japanese territory.\n\nFor residents in countries outside the jurisdiction of the Consular Service of the Embassy of Haiti in TOKYO, we strongly encourage you to contact the Haitian Embassy delegated to your region for assistance.\n\nPassports are issued to Haitian applicants on presentation of an identity document and proof of Haitian citizenship (passport, personal identification card). For this purpose, applicants must:\n\n- Complete and sign a passport application form;\n\n- Submit the following documents to the Consular Service of the Embassy or Consulate General authorized to serve you:\n\n1. A birth certificate issued by the Haitian National Archives (new blue and red certificate);\n\n2. The old passport and a second piece of valid identification (driver\u2019s license, student card, or residence card);\n\n3. Two valid pieces of identification if the old passport is not available;\n\n4. Two color passport photos on a white background, less than three (3) months old;\n\n5. An extract or original marriage certificate if the applicant is a married woman wishing to change her name;\n\n6. The original divorce certificate if the applicant is divorced and wishes to change her name;\n\n7. The husband\u2019s death certificate if the applicant is widowed and wishes to change her name;\n\n8. A parental authorization signed by a parent or legal guardian if the application is filed on behalf of a minor.\n\n\n\nPlease note: passports are issued for a period of ten (10) years for adults and five (5) years for minors (under 18s); no changes are permitted during this period. Any change of data on an issued passport must be made on the basis of a new, duly paid application. In the event of the loss of a valid passport, the applicant must submit a police report with the application form.\n\nRemark: in certain cases of extreme urgency, a travel certificate or 'feuille de route' may be issued in lieu of a passport to facilitate Haitian nationals' travel to Haiti. This 'feuille de route' is valid for one (1) month and one (1) trip only. It should be understood that Haitian nationals will not be able to return to Japan with this travel document. You must have your passport.\n\nPassport fees: Please consult our rates.\n\nWe accept major credit or debit cards (Visa and Mastercard), money orders, certified checks, or cashier\u2019s checks payable to the 'Embassy of Haiti in Japan.\u2019"},
gn4(){return"The Consular Section of the Embassy of the Republic of Haiti in Japan warmly welcomes you from Monday to Friday, from 9:00 a.m. to 4:00 p.m.\n\n\n\n In general, tourists traveling to Haiti do not need an entry visa. Their passports must be valid for at least 6 months, and they must pay a fee of US 10.00 upon arrival at the airport. However, nationals of the following countries require a visa to enter Haiti: the Dominican Republic, Panama, Colombia, Cuba, Syria, Libya, Iran, Vietnam, and Yemen.\n\nNationals of these 9 aforementioned countries (the Dominican Republic, Panama, Colombia, Cuba, Syria, Libya, Iran, and Vietnam) requiring a visa must apply at least one (1) month before their departure date and provide the following supporting documents:\n\nDuly completed and signed visa application form.Two (2) recent color passport photos.\n\nIn addition, a letter explaining the reason and duration of the stay is required, providing the following information:\n\n\nName, address, and phone number of the hotel or private residence where they will stay during their visit to Haiti.\n\n-\tValid passport information (at least for 6 months).\n\n-\tPhotocopy of the flight reservation or round-trip ticket.\n\n-\tLetter from the current employer.\n\n\n\nFees must be paid by money order, certified check, or bank draft payable to the 'Embassy of Haiti in Japan'."},
gn5(){return"The Consular Section of the Embassy of the Republic of Haiti in Japan warmly welcomes you from Monday to Friday, from 9:00 a.m. to 4:00 p.m.\n\n\n\n Diplomatic and official visas are issued on diplomatic or official passports and on United Nations laissez-passer, at the request of the institution for which the applicant works.\n\nThe following documents are required to issue a diplomatic or official visa:\n\n\nVisa application letter from the relevant institution\n\nValid passport\n\nTwo (2) color passport photos."},
gn6(){return"AUTHENTICATION OF JAPANESE DOCUMENT"},
gn7(){return"The Consular Section of the Embassy of the Republic of Haiti in Japan warmly welcomes you from Monday to Friday, from 9:00 a.m. to 4:00 p.m.\n\n\n\n All documents originating from Haiti can be authenticated/legalized by the Consular Section of the Haitian Embassy in TOKYO, if they have been previously authenticated by the Haitian Ministry of Foreign Affairs and Cults."},
gn8(){return"The Consular Section of the Embassy of the Republic of Haiti in Japan warmly welcomes you from Monday to Friday, from 9:00 a.m. to 4:00 p.m.\n\n\n\n A mandate or power of attorney is a potent instrument, endowing an individual (grantor) with the authority to entrust specific powers of legal representation to a chosen person (agent).\n\nFor any Haitian or individual of Haitian descent seeking to empower someone in Haiti as their representative (agent), it is imperative to present to the Consular Section a valid passport, accompanied by compelling evidence of Haitian nationality or origin. This evidence, whether in the form of a birth certificate or an expired passport, serves as a testament to the grantor's identity. The grantor must furnish essential details about the agent, including name(s), surname(s), residence, and either the taxpayer identification number (TIN) or passport number."},
gn9(){return"The Consular Section of the Embassy of the Republic of Haiti in Japan warmly welcomes you from Monday to Friday, from 9:00 a.m. to 4:00 p.m.\n\n\n\n In exceptional circumstances, the Consular Section, acting with authority, will expediently issue an identity certificate to Haitian nationals. This initiative aims to streamline their interactions with Japanese immigration authorities. However, it is imperative that individuals submit a passport application beforehand to avail themselves of this convenience."},
gna(){return"The Consular Section of the Embassy of the Republic of Haiti in Japan warmly welcomes you from Monday to Friday, from 9:00 a.m. to 4:00 p.m.\n\n\n\n Any Haitian parent residing in one of the states within the Embassy\u2019s jurisdiction can register his or her child with the Consular Section and obtain a birth certificate. The documents required are as follows:\n\n\n-\tParent\u2019s valid Haitian passport\n\n-\tParent\u2019s marriage certificate, if married\n\n-\tChild\u2019s foreign birth certificate and French translation."},
gnb(){return"The Consular Section of the Embassy of the Republic of Haiti in Japan warmly welcomes you from Monday to Friday, from 9:00 a.m. to 4:00 p.m.\n\n\n\n The documents required for the consular section to issue a death certificate are as follows:\n\n\n-\tThe deceased\u2019s passport\n\n-\tBurial permit\n\n-\tCertified copy of death certificate\n\n-\tPhotocopy of the funeral home\u2019s registration with the Health Department\n\n-\tPhotocopy of funeral invoice\n\n-\tA notarized letter certifying that the corpse is not contagious\n\n-\tA notarized letter on the funeral home\u2019s letterhead certifying that the corpse has been duly embalmed and will be transported in a properly sealed coffin.\n\n-\tThe itinerary of the corpse and the name and address of the funeral home that will handle the funeral in Haiti."},
