gmu(){return"Ranked as the second-largest island in the Caribbean, Haiti asserts its presence 77 km southeast of Cuba. Dominating the western third of the island, cohabiting with the Dominican Republic, Haiti proudly boasts a majestic coastline stretching over 1530 km. Commanding a mountainous terrain nestled between the North Atlantic Ocean and the South Caribbean Sea, Haiti's sovereignty extends beyond its mainland to include a constellation of islands, including but not limited to La Gon\xe2ve, La Tortue, \xcele-\xe0-Vache, La Navase, and more."},
gmq(){return"According to the 1987 Constitution, Article 3:\n\nThe emblem of the Haitian Nation shall be a flag with the following description:\n\n\nA) Two (2) boldly equal-sized horizontal bands: a commanding blue one on top, symbolizing the vastness of the sky, and a powerful red one underneath, representing the courage and resilience of the people;\n\nB) The coat of arms of the Republic shall be emblazoned proudly in the center on a field of pure white, signifying the pursuit of justice and unity;\n\nC) The coat of arms of the Republic stands tall with a Palmette, a symbol of triumph and victory, surmounted by the liberty cap, an emblem of freedom. Underneath the majestic palms lies a trophy adorned with the resounding legend: In Union, There is Strength (L\u2019Union Fait la Force), echoing the collective power and solidarity of the Haitian people."},
