gon(){return"Le vendredi 25 Mars 2022, dans une ambiance conviviale, l\u2019Ambassade de la R\xe9publique d'Ha\xefti au Japon a organis\xe9 la projection du film \u201cGouverneurs de la Ros\xe9e dans le cadre du \u201cmois de la francophonie.\n\n\xc0 l\u2019occasion de cette belle soir\xe9e de c\xe9l\xe9bration, la culture ha\xeftienne (art, artisanat, musique et gastronomie) a \xe9t\xe9 mise en valeur."},
goo(){return"L\u2019Ambassadeur de la R\xe9publique d\u2019Ha\xefti au Japon, M. Helph Monod HONORAT, a pris part, les 20 et 22 juin 2022, \xe0 une rencontre de haut niveau organis\xe9e par le Ministre des Affaires \xc9trang\xe8res du Japon, S.E.M.\n\nYoshimasa HAYASHI, avec les chefs de mission du groupe des Pays Latino-am\xe9ricains et Carib\xe9ens (GRULAC). Cette initiative s\u2019inscrit dans l\u2019objectif de pr\xe9senter l\u2019agenda diplomatique du Japon aux missions des pays de l\u2019Am\xe9rique Latine et de la Cara\xefbe pour l\u2019ann\xe9e fiscale 2022-2023.\n\n Le Ministre HAYASHI qui \xe9tait accompagn\xe9 de la directrice g\xe9n\xe9rale de la r\xe9gion de l\u2019Am\xe9rique Latine et des Cara\xefbes, Ambassadeur Maki KOBAYASHI, en a profit\xe9 pour remercier les pays latino-am\xe9ricains et carib\xe9ens de leur soutien \xe0 la suite de l\u2019\xe9lection du Japon au Conseil de S\xe9curit\xe9 des Nations Unies durant la p\xe9riode 2023-2024 comme membre non-permanent.\n\nIl a renouvel\xe9 l\u2019engagement et la disponibilit\xe9 du gouvernement japonais \xe0 poursuivre et \xe0 renforcer ses   efforts de soutien aux Pays Latino-am\xe9ricains et Carib\xe9ens \xe0 travers des projets de coop\xe9ration technique, l\u2019envoi d\u2019experts et le financement pour le d\xe9veloppement.  Il a \xe9galement soulign\xe9 l\u2019importance pour le Japon du GRULAC qui regroupe des partenaires importants avec lesquels le Japon partage des valeurs fondamentales comme la d\xe9mocratie et les droits humains. L\u2019Ambassadeur HONORAT, dans son intervention, a saisi l\u2019occasion pour mettre en exergue l\u2019efficacit\xe9 de la coop\xe9ration japonaise en Ha\xefti tout en pr\xe9sentant, au nom du Gouvernement ha\xeftien, ses mots de gratitude pour l\u2019int\xe9r\xeat particulier que le Japon porte \xe0 Ha\xefti. Il a formul\xe9, en outre, son souhait de voir la coop\xe9ration japonaise inclure, dans un avenir proche, des investissements relatifs \xe0 la culture, la science, l\u2019innovation et la technologie pouvant contribuer \xe0 la modernisation des infrastructures et au d\xe9veloppement durable d\u2019Ha\xefti. L'ambassadeur a aussi fait remarquer que l\u2019appui du Japon sera toujours tr\xe8s utile aux pays de la Cara\xefbe pour   r\xe9soudre des probl\xe8mes li\xe9s au r\xe9chauffement climatique et aux catastrophes naturelles."},
gop(){return"L\u2019Ambassade d\u2019Ha\xefti au Japon a re\xe7u le 16 ao\xfbt 2022 la visite des \xe9l\xe8ves du programme de garde apr\xe8s \xe9cole \xab Kids Forest \xbb. La Mission a r\xe9alis\xe9 une belle journ\xe9e de d\u2019interaction avec les \xe9l\xe8ves et les enseignants de Kids Forest.\n\nLe groupe, treize \xe9l\xe8ves \xe2g\xe9s entre 7 et 10 ans et quatre enseignants, est arriv\xe9 \xe0 l\u2019Ambassade dans l\u2019apr\xe8s-midi. Une s\xe9ance de pr\xe9sentation sur l\u2019histoire, la culture et les traditions ha\xeftiennes a eu lieu dans la salle de conf\xe9rence, puis le groupe a effectu\xe9 une visite guid\xe9e des locaux de la Mission avant de prendre cong\xe9. Cette visite s\u2019inscrit dans le cadre de l\u2019objectif de la Mission de promouvoir les richesses culturelles et historiques d\u2019Ha\xefti aupr\xe8s des jeunes japonais.\n\nEn effet, ces opportunit\xe9s d\u2019\xe9change et de partage permettent aux jeunes de d\xe9couvrir d\u2019autres cultures et ouvrir leurs horizons sur le monde."},
