gn7(){return"La Section consulaire de l'Ambassade de la R\xe9publique d'Ha\xefti au Japon vous accueille avec dynamisme du lundi au vendredi, de 9h00 \xe0 16h00.\n\n\n\n Tous les documents en provenance d\u2019Ha\xefti peuvent \xeatre authentifi\xe9s/l\xe9galis\xe9s par la Section consulaire de l\u2019Ambassade d\u2019Ha\xefti \xe0 TOKYO, s\u2019ils ont \xe9t\xe9 pr\xe9alablement authentifi\xe9s par le Minist\xe8re des Affaires Etrang\xe8res et des Cultes d\u2019Ha\xefti."},
gn8(){return"La Section consulaire de l'Ambassade de la R\xe9publique d'Ha\xefti au Japon vous accueille avec dynamisme du lundi au vendredi, de 9h00 \xe0 16h00.\n\n\n\n Un mandat ou procuration conf\xe8re \xe0 un individu (mandant) le pouvoir de confier des responsabilit\xe9s de repr\xe9sentation l\xe9gale \xe0 une autre personne de son choix (mandataire).\n\nPour tout Ha\xeftien ou personne d\u2019origine ha\xeftienne d\xe9sirant habiliter une personne en Ha\xefti en tant que mandataire, il est imp\xe9ratif de pr\xe9senter \xe0 la Section Consulaire un passeport en cours de validit\xe9 accompagn\xe9 d'une preuve de nationalit\xe9 ou d'origine ha\xeftienne. Cette preuve peut prendre la forme d'un acte de naissance ou d'un passeport expir\xe9. Le mandant doit \xe9galement \xeatre en mesure de fournir des informations cruciales sur le mandataire, y compris ses nom(s), pr\xe9nom(s), adresse, ainsi que son num\xe9ro de carte d'identification fiscale (NIF) ou de passeport."},
gn9(){return"La Section consulaire de l'Ambassade de la R\xe9publique d'Ha\xefti au Japon vous accueille avec dynamisme du lundi au vendredi, de 9h00 \xe0 16h00.\n\n\n\n En des circonstances exceptionnelles, la Section Consulaire, agissant avec autorit\xe9, d\xe9livrera de mani\xe8re exp\xe9ditive un certificat d'identit\xe9 aux ressortissants ha\xeftiens. Cette d\xe9marche vise \xe0 simplifier leurs interactions avec les autorit\xe9s Japonaise en mati\xe8re d'immigration. Il est toutefois imp\xe9ratif que les int\xe9ress\xe9s d\xe9posent pr\xe9alablement une demande de passeport pour b\xe9n\xe9ficier de cette facilit\xe9."},
gna(){return"La Section consulaire de l'Ambassade de la R\xe9publique d'Ha\xefti au Japon vous accueille avec dynamisme du lundi au vendredi, de 9h00 \xe0 16h00.\n\n\n\n Tout parent ha\xeftien r\xe9sidant dans l\u2019un des Etats faisant partie de la juridiction de l\u2019Ambassade peut d\xe9clarer son enfant \xe0 la Section Consulaire et obtenir son acte de naissance. Les documents requis sont les suivants :\n\n-\tLe passeport ha\xeftien valide du parent\n\n-\tL\u2019acte de mariage du parent, s\u2019il est mari\xe9\n\n-\tL\u2019acte de naissance \xe9tranger de l\u2019enfant et sa traduction fran\xe7aise."},
