gn3(){return"Seksyon Konsily\xe8l la nan Ambasad Repiblik Ayiti nan Japon a ap resevwa ou ak en\xe8ji Pepi lendi rive vandredi, soti 9:00 a.m. rive 4:00 p.m.\n\n\n\n S\xf2ti nan Tokyo, Seksyon Konsily\xe8l nou an gen jiridiksyon sou tout teritwa Japon\xe8. \n\nPou moun ki rete nan peyi ki pa anba jiridiksyon S\xe8vis Konsily\xe8l la nan Ambasad Ayiti nan TOKYO, nou ankouraje ou kontakte Ambasad Ayisyen ki nan rejyon ou a pou li ka \xe9d\xe9\u2019w.\n\nNou r\xe9m\xe8t Paspo pou moun ki se sitwayen ayisyen sou prezantasyon yon dokiman idantite ak pwov ditantite ayisyen (paspo, kat idantifikasyon p\xe8son\xe8l). Pou sa ka f\xe8t, moun ki mande dwe:\n\n\n- Ranpli ak siyen yon f\xf2mil\xe8 demann paspo;\n\n- Voye dokiman ki swiv yo bay S\xe8vis Konsily\xe8l la nan Ambasad la oswa Konsila Jeneral ki otorize s\xe8vi ou:\n\n1. Yon akt de n\xe8sans delivre pa Achiv Nasyonal Ayiti (nouvo s\xe8tifika ble ak wouj);\n\n2. Ansyen paspo a ak yon dezy\xe8m py\xe8s idantifikasyon ki valab (p\xe8mi kondwi, kat etidyan, oswa kat rezidan);\n\n3. De py\xe8s idantifikasyon ki valab si ansyen paspo a pa disponib;\n\n4. De foto paspo koul\xe8 sou yon fon blan, ki dat\xe9 de mwens twa (3) mwa;\n\n5. Yon ekstr\xe8 oswa akte maryaj orijinal, si moun mande a se yon fanm marye ki vle chanje non l;\n\n6. S\xe8tifika div\xf2s orijinal, si moun mande a se yon fanm div\xf2se ki vle chanje non l;\n\n7. S\xe8tifika lanm\xf2 mari a si moun mande a se yon fanm vif ki vle chanje non l;\n\n8. Yon otorizasyon paran siyen pa yon paran oswa gadyen legal, si demann an depoze nan se pou yon ti moun.\n\nTanpri sonje: paspo rem\xe8t pou yon pery\xf2d dis (10) lane pou granmoun ak senk (5) lane pou ti moun (anba 18 an); pa gen p\xe8misyon pou f\xe8 chanjman pandan pery\xf2d sa a. Tout chanjman don\xe9 sou yon paspo ki te rem\xe8t dwe f\xe8t sou baz yon nouvo demann byen peye. An ka de p\xe8di yon paspo ki valab, moun ki mande a dwe voye yon rap\xf2 polis ansanm ak f\xf2mil\xe8 demann an.\n\n\n\nOby\xe8vasyon: nan k\xe8k ka anraje ekstr\xe8m, yon s\xe8tifika vwayaj oswa feuille de route ka rem\xe8t anplas yon paspo pou fasilite vwayaj sitwayen ayisyen rive Ayiti. Feuille de route sa a valab pou yon (1) mwa ak yon (1) s\xe8l vwayaj. F\xf2k konprann ke sitwayen ayisyen pa pral ka retounen Ozetazini av\xe8k dokiman vwayaj sa a. Ou dwe gen paspo ou.\n\n\n\nFrais paspo: tanpri konsilte pri nou yo.\n\nNou aksepte kat kredi oswa debi pi gwo (Visa ak Mastercard), manda, tch\xe8k s\xe8tifye oswa tch\xe8k kasye peye a Ambasad Ayiti nan Japon."},
gn4(){return"Seksyon Konsily\xe8l la nan Ambasad Repiblik Ayiti nan Japon a ap resevwa ou ak en\xe8ji Pepi lendi rive vandredi, soti 9:00 a.m. rive 4:00 p.m.\n\n\n\n Anjeneral, touris k ap vwayaje ann Ayiti pa bezwen viza. Pasp\xf2 yo dwe valid pou omwen 6 mwa epi yo dwe peye yon fr\xe8 10 dola ameriken l\xe8 yo rive nan ayewop\xf2 Ayiti.\n\n-Sepandan, gen 9 peyi sitwayen yo bezwen viza pou antre ann Ayiti : Repiblik Dominik\xe8n, Panama, Kolonbi, Kiba, Siri, Libi, Iran, Vyetnam ak Yem\xe8n.\n\nSitwayen 9 peyi sa yo (Repiblik Dominik\xe8n, Panama, Kolonbi, Kiba, Siri, Libi, Iran, Vyetnam ak Yemen) dwe aplike pou viza omwen yon (1) mwa anvan dat depa yo epi prezante dokiman sa yo :\n\n\nF\xf2mil\xe8 Aplikasyon pou Viza a, byen ranpli epi siyen;-\tDe (2) foto pasp\xf2 resan an koul\xe8;-\tL\xe8t pou eksplike rezon ki f\xe8 yo vle vwayaje epi konbyen tan yo vle pase ann Ayiti, epi bay enf\xf2masyon sa yo :\n\n\n1. Non, adr\xe8s ak nimewo telef\xf2n ot\xe8l oswa kay prive kote yo pral desann pandan sejou yo ann Ayiti ;\n\n2. Pasp\xf2 ki valid (omwen pou 6 mwa) ;\n\n3. Fotokopi konfimasyon rez\xe8vasyon oswa tik\xe8 avyon ale/retou ;\n\n4. L\xe8t kote li ap travay akty\xe8lman.\n\n\nFr\xe8\xa0yo dwe peye ak \u201cmoney order\u201d, ch\xe8k s\xe8tifye oswa ch\xe8k labank sou non \u201cEmbassy of Haiti in Washington\u201d."},
gn5(){return"Seksyon Konsily\xe8l la nan Ambasad Repiblik Ayiti nan Japon a ap resevwa ou ak en\xe8ji Pepi lendi rive vandredi, soti 9:00 a.m. rive 4:00 p.m.\n\n\n\n Anbasad la em\xe8t viza diplomatik oswa ofisy\xe8l sou pasp\xf2 diplomatik, pasp\xf2 ofisy\xe8l oswa sou \u201clesepase\u201d que Nasyonzini em\xe8t yo.n\n\nDokiman sa yo obligatwa pou emisyon viza diplomatik oswa viza ofisy\xe8l :\n\n\n-\tN\xf2t diplomatik d enstitisyon ki mande viza a ;\n\n-\tPasp\xf2 valid diplomat oswa ofisy\xe8l k ap vwayaje a ;\n\n-\tDe (2) foto pasp\xf2 an koul\xe8.\n\n"},
