gn7(){return"Seksyon Konsily\xe8l la nan Ambasad Repiblik Ayiti nan Japon a ap resevwa ou ak en\xe8ji Pepi lendi rive vandredi, soti 9:00 a.m. rive 4:00 p.m.\n\n\n\n Tout dokiman ki soti ann Ayiti ka otantifye oswa legalize pa Seksyon konsil\xe8 Anbasad Ayiti nan TOKYO, si yo te deja otantifye oswa legalize pa Minist\xe8 Zaf\xe8 Etranj\xe8 ak Kilt ann Ayiti."},
gn8(){return"Seksyon Konsily\xe8l la nan Ambasad Repiblik Ayiti nan Japon a ap resevwa ou ak en\xe8ji Pepi lendi rive vandredi, soti 9:00 a.m. rive 4:00 p.m.\n\n\n\n Yon manda oswa pwokirasyon se yon zam pwisan, ki ba yon moun (mandan) otorizasyon pou li delege k\xe8k pouvwa repr\xe9zantasyon legal bay yon l\xf2t moun li chwazi (mandat\xe8) pou l' reprzante legalman.\n\nPou nenp\xf2t Ayisyen oswa moun ki gen orijin ayisyen ki vle bay yon moun an Ayiti pou l' reprzante k\xf2m mandat\xe8, li dwe prezante devan Seksyon Konsily\xe8 a yon pasp\xf2 an vayan ak yon premye pr\xe8v serye de nasyonalite li oswa orijin ayisyen li. Premye pr\xe8v sa a ka yon ak\xf2 nesans oswa yon pasp\xf2 ki fin ekspire. Li enp\xf2tan pou moun ki vle bay manda a ka bay enf\xf2masyon ki enp\xf2tan sou mandat\xe8 a tankou non li, adr\xe8s li, epi nimewo ID fiskal (NIF) oswa nimewo pasp\xf2 li."},
gn9(){return"Seksyon Konsily\xe8l la nan Ambasad Repiblik Ayiti nan Japon a ap resevwa ou ak en\xe8ji Pepi lendi rive vandredi, soti 9:00 a.m. rive 4:00 p.m.\n\n\n\n Nan kondisyon eksepsyon\xe8l, Seksyon Konsily\xe8 a, an aksyon av\xe8k otorite, pral bay yon s\xe8tifika idantite byen rapid bay sitwayen ayisyen. Men sa se yon demach ki gen pou objektif simplifye relasyon yo ak otorite Japon\xe8z yo nan zaf\xe8 imigrasyon. Men, se enp\xf2tan pou moun yo depoze yon demann pasp\xf2 avan pou yo ka benefisye de avantaj sa a."},
gna(){return"Seksyon Konsily\xe8l la nan Ambasad Repiblik Ayiti nan Japon a ap resevwa ou ak en\xe8ji Pepi lendi rive vandredi, soti 9:00 a.m. rive 4:00 p.m.\n\n\n\n Yon paran ayisyen ki abite nan youn nan Eta ameriken ki sou jiridiksyon Anbasad la ka deklare pitit li nan Seksyon konsil\xe8 Anbasad la pou li ka jwenn batist\xe8 pou pitit li. Men dokiman li dwe prezante :\n\n\n-\tPasp\xf2 ayisyen valid paran an ;\n\n-\tS\xe8tifika maryaj paran an, si li marye ;\n\n-\tBatist\xe8 etranje timoun nan ak tradiksyon li an franse."},
gnb(){return"Seksyon Konsily\xe8l la nan Ambasad Repiblik Ayiti nan Japon a ap resevwa ou ak en\xe8ji Pepi lendi rive vandredi, soti 9:00 a.m. rive 4:00 p.m.\n\n\n\n Men dokiman ki neses\xe8 pou jwenn otorizasyon pou ekspedye yon kadav ann Ayiti :\n\n\n-\tPasp\xf2 moun ki mouri a ;\n\n-\tP\xe8mi pou ant\xe8man an ;\n\n-\tYon kopi s\xe8tifye d akt des\xe8 a ;\n\n-\tYon fotokopi anrejistreman mezon finer\xe8 a nan Minist\xe8 Sante (Health Department) ;\n\n-\tFotokopi fakti ant\xe8man an\n\n-\tYon l\xe8t notarye ki ateste kadav la pa kontajye ;\n\n-\tYon l\xe8t notarye sou papye ant\xe8t mezon finer\xe8 a ki ateste ke kadav la byen anbonme epi yo pral transp\xf2te l nan yon s\xe8k\xe8y ki byen f\xe8men ;\n\n-\tItiner\xe8 yo pral f\xe8 ak kadav la, ak enf\xf2masyon pou kontakte mezon finr\xe8 a ki pral fe ant\xe8man an ann Ayiti."},
