gt0(){return"\ubc14\uc26c \uc12c\uc758 \uc790\uc5f0 \uc544\ub984\ub2e4\uc6c0\uc744 \ubc1c\uacac\ud558\uc138\uc694. \uc774\uacf3\uc740 \uc544\uc774\ud2f0 \ud574\uc548\uc5d0 \uc704\uce58\ud55c \uc5f4\ub300\uc758 \ub099\uc6d0\uc785\ub2c8\ub2e4. \ud770 \ubaa8\ub798 \ud574\ubcc0, \ub9d1\uc740 \ubc14\ub2e4\ubb3c, \ud3c9\ud654\ub85c\uc6b4 \ubd84\uc704\uae30\ub85c \uac00\ub4dd\ud55c \ubc14\uc26c \uc12c\uc740 \ud30c\ub77c\ub2e4\uc774\uc2a4\uc758 \ud0c8\ucd9c\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4. \ud604\uc9c0 \ubb38\ud654\uc758 \ud48d\ubd80\ud568\uc744 \ud0d0\ud5d8\ud558\uace0 \uc9c4\uc815\ud55c \uc694\ub9ac\ub97c \ub9db\ubcf4\uba70 \ud604\uc9c0 \uc8fc\ubbfc\ub4e4\uc758 \ub530\ub73b\ud55c \ud658\uc601\uc5d0 \ud479 \ube60\uc838\ubcf4\uc138\uc694. \ubc14\uc26c \uc12c\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4. \uce74\ub9ac\ube0c \ud574\uc758 \ud478\ub978 \ubc14\ub2e4\uc5d0 \uc228\uaca8\uc9c4 \ubcf4\ubb3c\uc785\ub2c8\ub2e4."},
gpr(){return"\uc544\uc774\ud2f0\uc758 \ud48d\ubd80\ud55c \uc74c\uc2dd\uc744 \ub9db\ubcf4\uc138\uc694. \ubb38\ud654\uc801\uc778 \ub9db\uc73c\ub85c \uac00\ub4dd \ucc2c \uc544\uc774\ud2f0 \uc694\ub9ac\ub294 \ub9db\uacfc \uc804\ud1b5\uc758 \uc5ec\ud589\uc73c\ub85c \ub370\ub824\ub2e4\uc8fc\ub294 \ub9e4\ud639\uc801\uc778 \uacbd\ud5d8\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4. 1\uc6d4 1\uc77c\uc758 \ub3c5\ub9bd \uae30\ub150\uc77c\uc744 \uae30\ub150\ud558\ub294 \ud638\ubc15 \uc218\ud504\ubd80\ud130 tchaka\uc640 bannann peze\uc640 \uac19\uc740 \ub2ec\ucf64\ud55c \uac04\uc2dd, \ub2f9\uc2e0\uc740 \uce74\ub9ac\ube0c \ud574\uc758 \ud0dc\uc591 \uc544\ub798 \ub9db\uc788\ub294 \ubaa8\ud5d8\uc5d0 \ub5a0\ub0a9\ub2c8\ub2e4."},
gps(){return"\uc544\uc774\ud2f0\uc758 \uc608\uc220\uacfc \ud68c\ud654\uc758 \ud48d\ubd80\ud568\uc5d0 \ud479 \ube60\uc838 \ubcf4\uc138\uc694. \uc544\uc774\ud2f0\uc758 \uc608\uc220 \uc791\ud488\uc740 \ub3c5\ud2b9\ud55c \ud615\ud0dc\ub85c \uc0b6, \ubb38\ud654, \ucc3d\uc758\uc131\uc744 \ubc18\uc601\ud569\ub2c8\ub2e4. \uadf8\ub9bc\uc5d0\uc11c \ud06c\ub9ac\uc5d0\uc774\ud2f0\ube0c\ud55c \uadf8\ub798\ud53d\uae4c\uc9c0, \ubaa8\ub4e0 \uc885\ub958\uc758 \uc608\uc220\uc774 \uc544\uc774\ud2f0\uc5d0 \ud2b9\ubcc4\ud55c \ud130\uce58\ub97c \ub354\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc0c9, \ud615\ud0dc, \uc774\ubbf8\uc9c0\ub85c \ub9d0\ud560 \uc218 \uc788\ub294 \uae00\ub85c\ubc8c\ud55c \uc138\uacc4\ub97c \ud0d0\ud5d8\ud558\uc138\uc694."},
gpt(){return"\uc544\uc774\ud2f0 \uc74c\uc545\uc758 \ub9ac\ub4ec\uc5d0 \ud479 \ube60\uc838 \ubcf4\uc138\uc694. \ucf64\ud30c\uc2a4\uc758 \ud65c\uae30\ucc2c \ube44\ud2b8\uc5d0\uc11c \ub77c\ub77c\uc758 \uac10\ubbf8\ub85c\uc6b4\u65cb\u5f8b\uae4c\uc9c0, \uc544\uc774\ud2f0\uc758 \uc74c\uc545 \ud48d\uacbd\uc740 \ub2e4\uc591\uc131\uacfc \uc804\ud1b5\uc758 \ucd95\uc81c\uc785\ub2c8\ub2e4. \ub9e4\ud639\uc801\uc778 \uace1\ub4e4\uc744 \ud1b5\ud574 \ub098\ub77c\uc758 \uc2ec\uc7a5 \ubc15\ub3d9\uc744 \uccb4\ud5d8\ud558\uace0 \ubaa8\ub4e0 \uc74c\ud45c\uc5d0 \ub0b4\uc7a5\ub41c \ubb38\ud654\uc801 \ud48d\ubd80\ud568\uc744 \ubc1c\uacac\ud558\uc138\uc694."},
gpu(){return"\uc544\uc774\ud2f0 \ub7fc\uc758 \uc5ed\uc0ac\uc640 \ub9db\uc5d0 \ube60\uc838 \ubcf4\uc138\uc694. \uc0ac\ud0d5\uc218\uc218 \ubc2d\uc5d0\uc11c \uc218\uacf5\uc608 \uc99d\ub958\uc18c\uae4c\uc9c0, \uc544\uc774\ud2f0 \ub7fc\uc740 \uc804\ud1b5 \uac00\ub4dd\ud55c \uac10\uac01\uc801\uc778 \uacbd\ud5d8\uc785\ub2c8\ub2e4. \uac01 \ubcd1 \ub4a4\uc758 \uc7a5\uc778 \uc815\uc2e0\uc744 \ubc1c\uacac\ud558\uace0, \ub9e4 \uc785\ub9c8\ub2e4\uc758 \ub258\uc559\uc2a4\ub97c \ub9db\ubcf4\uba70, \uc544\uc774\ud2f0 \ub7fc\uc758 \ub9e4\ud639\uc801\uc778 \ub9e4\ub825\uc5d0 \ud729\uc2f8\uc774\uc138\uc694."},
gpv(){return"\uac70\ubd81\uc12c\uc758 \uc790\uc5f0 \uc544\ub984\ub2e4\uc6c0\uc744 \ud0d0\ud5d8\ud558\uc2ed\uc2dc\uc624. \ud558\uc774\ud2f0 \ud574\uc548\uc758 \uc5f4\ub300 \uc6a9\ub0a9\uc9c0\ub85c, \ud770 \ubaa8\ub798\uc0ac\uc7a5, \ub9d1\uc740 \ubb3c, \ud3c9\ud654\ub85c\uc6b4 \ubd84\uc704\uae30\ub85c \uac00\ub4dd\ucc2c \uac70\ubd81\uc12c\uc740 \ub099\uc6d0\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4. \ud604\uc9c0 \ubb38\ud654\uc758 \ud48d\ubd80\ud568\uc744 \ud0d0\ud5d8\ud558\uace0 \uc815\ud1b5 \uc74c\uc2dd\uc744 \ub9db\ubcf4\uba70 \ud604\uc9c0 \uc8fc\ubbfc\ub4e4\uc758 \ub530\ub73b\ud55c \ud658\ub300\uc5d0 \ud760\ubed1 \ucde8\ud574\ubcf4\uc138\uc694. \ub77c \ud1a0\ub974\ud29c \uc12c\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4, \uce74\ub9ac\ube0c \ud574\uc758 \ud478\ub978 \ubc14\ub2e4\uc5d0 \uac10\ucdb0\uc9c4 \ubcf4\ubb3c \uc18d\uc73c\ub85c."},
