gn0(){return"2022\ub144 3\uc6d4 25\uc77c \uae08\uc694\uc77c, \ubd84\uc704\uae30 \uc88b\uc740 \ubd84\uc704\uae30\uc5d0\uc11c \uc544\uc774\ud2f0 \uacf5\ud654\uad6d \ub300\uc0ac\uad00\uc740 'Governors of the Dew'\ub77c\ub294 \uc601\ud654 \uc0c1\uc601\ud68c\ub97c \uac1c\ucd5c\ud588\uc2b5\ub2c8\ub2e4. \uc774 \uc544\ub984\ub2e4\uc6b4 \ucd95\ud558\uc758 \ubc24\uc5d0\ub294 \uc544\uc774\ud2f0 \ubb38\ud654 (\ubbf8\uc220, \uacf5\uc608, \uc74c\uc545, \uc694\ub9ac)\uac00 \uc120\ubcf4\uc600\uc2b5\ub2c8\ub2e4."},
gn1(){return"\uc77c\ubcf8\uc758 \uc678\ubb34 \uc7a5\uad00 \uc778 Yoshimasa HAYASHI, GRULAC\uc758 \uad6d\uac00 \ub2e8\uc704 \uc7a5\uad50\ub4e4\uc774 \uc8fc\ucd5c\ud55c \uace0\uc704\uae09 \ud68c\uc758\uc5d0 \ucc38\uc11d\ud55c Haiti Republic \ub300\uc0ac Helph Monod HONORAT\uc528. \uc774 \uc774\ub2c8\uc154\ud2f0\ube0c\ub294 \uc77c\ubcf8\uc758 \uc678\uad50 \uc77c\uc815\uc744 \ub77c\ud2f4 \uc544\uba54\ub9ac\uce74 \ubc0f \uce74\ub9ac\ube0c \ud574 \uad6d\uac00\ub4e4\uc758 \ubbf8\uc158\uc5d0 \uc18c\uac1c\ud558\ub294 \uac83\uc744 \ubaa9\ud45c\ub85c \ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc5f0\ub3c4 2022-2023."},
gn2(){return"\uc544\uc774\ud2f0 \ub300\uc0ac\uad00\uc740 2022\ub144 8\uc6d4 16\uc77c\uc5d0 \ubc29\uacfc \ud6c4 \ubcf4\uc721 \ud504\ub85c\uadf8\ub7a8 'Kids Forest'\uc758 \ud559\uc0dd\ub4e4\uc744 \ub9de\uc774\ud588\uc2b5\ub2c8\ub2e4. \ubbf8\uc158\uc740 Kids Forest\uc758 \ud559\uc0dd\ub4e4\uacfc \uad50\uc0ac\ub4e4\uacfc\uc758 \uba4b\uc9c4 \ud558\ub8e8\ub97c \ubcf4\ub0c8\uc2b5\ub2c8\ub2e4. 7\uc5d0\uc11c 10\uc138\uc778 13\uba85\uc758 \ud559\uc0dd\uacfc 4\uba85\uc758 \uad50\uc0ac\ub85c \uad6c\uc131\ub41c \uadf8\ub8f9\uc740 \uc624\ud6c4\uc5d0 \ub300\uc0ac\uad00\uc5d0 \ub3c4\ucc29\ud588\uc2b5\ub2c8\ub2e4. \ud68c\uc758\uc2e4\uc5d0\uc11c\ub294 \uc544\uc774\ud2f0\uc758 \uc5ed\uc0ac, \ubb38\ud654 \ubc0f \uc804\ud1b5\uc5d0 \ub300\ud55c \ud504\ub808\uc820\ud14c\uc774\uc158\uc774 \uc774\ub8e8\uc5b4\uc9c4 \ud6c4 \ubbf8\uc158 \uc2dc\uc124\uc758 \uc548\ub0b4 \ud22c\uc5b4\uac00 \uc9c4\ud589\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc791\ubcc4 \uc778\uc0ac\uac00 \uc774\ub8e8\uc5b4\uc9c4 \ud6c4\uc5d0\uc57c \ud588\uc2b5\ub2c8\ub2e4."},
gmJ(){return"\ub354 \uc77d\uae30"},
gon(){return"2022\ub144 3\uc6d4 25\uc77c \uae08\uc694\uc77c, \ud654\uae30 \ub118\uce58\ub294 \ubd84\uc704\uae30\uc5d0\uc11c \ud558\uc774\ud2f0 \uacf5\ud654\uad6d \uc8fc\uc7ac \uc77c\ubcf8 \ub300\uc0ac\uad00\uc740 '\ud504\ub791\uc2a4\uc5b4 \uc6d4' \ud589\uc0ac\uc758 \uc77c\ud658\uc73c\ub85c '\ub85c\uc81c\uc758 \uc9c0\ubc30\uc790' \uc601\ud654 \uc0c1\uc601\uc744 \uac1c\ucd5c\ud588\uc2b5\ub2c8\ub2e4.\n\n\uc774 \uc544\ub984\ub2e4\uc6b4 \ucd95\ud558\uc758 \ubc24\uc5d0\uc11c \ud558\uc774\ud2f0 \ubb38\ud654(\ubbf8\uc220, \uacf5\uc608, \uc74c\uc545 \ubc0f \uc74c\uc2dd)\uac00 \uac15\uc870\ub418\uc5c8\uc2b5\ub2c8\ub2e4."},
goo(){return"\ud558\uc774\ud2f0 \uacf5\ud654\uad6d \uc8fc\uc7ac \uc77c\ubcf8 \ub300\uc0ac \ud5ec\ud504 \ubaac\ub4dc \uc624\ub178\ub77c\ub294 2022\ub144 6\uc6d4 20\uc77c\uacfc 22\uc77c\uc5d0 \uc77c\ubcf8 \uc678\uad50\uc7a5\uad00 \uc694\uc2dc\ub9c8\uc0ac \ud558\uc57c\uc2dc\uac00 \uc8fc\ucd5c\ud55c \ub77c\ud2f4\uc544\uba54\ub9ac\uce74 \ubc0f \uce74\ub9ac\ube0c\ud574 \uad6d\uac00 \uadf8\ub8f9(GRULAC)\uc758 \ub300\uc0ac\ub2e8\uc7a5 \ud68c\uc758\uc5d0 \ucc38\uc11d\ud588\uc2b5\ub2c8\ub2e4.\n\n\uc774 \uacc4\ud68d\uc740 \uc77c\ubcf8\uc758 2022-2023 \ud68c\uacc4 \uc5f0\ub3c4\uc5d0 \ub300\ud55c \uc678\uad50 \uc77c\uc815\uc744 \ub77c\ud2f4\uc544\uba54\ub9ac\uce74 \ubc0f \uce74\ub9ac\ube0c\ud574 \uad6d\uac00 \ubbf8\uc158\uc5d0 \uc18c\uac1c\ud558\uae30 \uc704\ud55c \uac83\uc785\ub2c8\ub2e4. \ud558\uc57c\uc2dc \uc7a5\uad00\uc740 \ub77c\ud2f4\uc544\uba54\ub9ac\uce74 \ubc0f \uce74\ub9ac\ube0c\ud574 \uad6d\uac00\uac00 2023-2024 \uae30\uac04\uc758 \ube44\uc0c1\uc784 \uc774\uc0ac\ub85c \uc77c\ubcf8 \uc120\ucd9c\uc5d0 \ub300\ud55c \uc9c0\uc6d0\uc5d0 \uac10\uc0ac\ud558\ub2e4\uace0 \ub9d0\ud558\uba70, \uc774\uc5d0 \ub530\ub77c \uc77c\ubcf8 \uc815\ubd80\uac00 \uae30\uc220 \ud611\ub825 \ud504\ub85c\uc81d\ud2b8, \uc804\ubb38\uac00 \ud30c\uacac \ubc0f \uac1c\ubc1c \uc790\uae08\uc744 \ud1b5\ud55c \ub77c\ud2f4\uc544\uba54\ub9ac\uce74 \ubc0f \uce74\ub9ac\ube0c\ud574 \uad6d\uac00\uc5d0 \ub300\ud55c \uc9c0\uc6d0\uc744 \uacc4\uc18d \uac15\ud654\ud560 \uc758\uc9c0\ub97c \uac15\uc870\ud588\uc2b5\ub2c8\ub2e4.\n\n\uadf8\ub294 \ub610\ud55c GRULAC\uc758 \uc911\uc694\uc131\uc744 \uac15\uc870\ud588\ub294\ub370, \uc774\ub294 \ubbfc\uc8fc\uc8fc\uc758 \ubc0f \uc778\uad8c\uacfc \uac19\uc740 \uae30\ubcf8 \uac00\uce58\ub97c \uacf5\uc720\ud558\ub294 \uc911\uc694\ud55c \ud30c\ud2b8\ub108\ub4e4\uc774 \ubaa8\uc778 \uacf3\uc785\ub2c8\ub2e4. \uc624\ub178\ub77c \ub300\uc0ac\ub294 \uadf8\uc758 \uc5f0\uc124\uc5d0\uc11c \uc77c\ubcf8\uacfc \ud558\uc774\ud2f0 \uac04\uc758 \ud611\ub825\uc758 \ud6a8\uacfc\ub97c \uac15\uc870\ud558\uba74\uc11c, \uc77c\ubcf8\uc774 \ud558\uc774\ud2f0\uc5d0 \ud2b9\ubcc4\ud55c \uad00\uc2ec\uc744 \uae30\uc6b8\uc774\uace0 \uc788\ub294 \ub370 \ub300\ud55c \ud558\uc774\ud2f0 \uc815\ubd80\uc758 \uac10\uc0ac\uc758 \ub9d0\uc744 \uc804\ud588\uc2b5\ub2c8\ub2e4.\n\n\uadf8\ub294 \ub610\ud55c \uc77c\ubcf8\uc758 \uc9c0\uc6d0\uc774 \uce74\ub9ac\ube0c\ud574 \uad6d\uac00\uac00 \uae30\ud6c4 \ubcc0\ud654 \ubc0f \uc790\uc5f0 \uc7ac\ud574\uc640 \uad00\ub828\ub41c \ubb38\uc81c\ub97c \ud574\uacb0\ud558\ub294 \ub370 \ud56d\uc0c1 \uc720\uc6a9\ud558\ub2e4\uace0 \uac15\uc870\ud588\uc2b5\ub2c8\ub2e4."},
gop(){return"\ud558\uc774\ud2f0 \uc8fc\uc7ac \uc77c\ubcf8 \ub300\uc0ac\uad00\uc740 2022\ub144 8\uc6d4 16\uc77c\uc5d0 '\ud0a4\uc988 \ud3ec\ub808\uc2a4\ud2b8' \ud6c4\uc6d0 \ud504\ub85c\uadf8\ub7a8 \ud559\uc0dd\ub4e4\uc744 \ubc1b\uc558\uc2b5\ub2c8\ub2e4. \ub300\uc0ac\ub2e8\uc740 '\ud0a4\uc988 \ud3ec\ub808\uc2a4\ud2b8' \ud559\uc0dd\ub4e4 \ubc0f \uad50\uc0ac\ub4e4\uacfc \uc0c1\ud638 \uc791\uc6a9\ud558\ub294 \uba4b\uc9c4 \ud558\ub8e8\ub97c \uac00\uc84c\uc2b5\ub2c8\ub2e4.\n\n\uc774 13\uba85\uc758 7~10\uc138 \ud559\uc0dd\uacfc 4\uba85\uc758 \uad50\uc0ac\ub85c \uad6c\uc131\ub41c \uadf8\ub8f9\uc740 \uc624\ud6c4\uc5d0 \ub300\uc0ac\uad00\uc5d0 \ub3c4\ucc29\ud588\uc2b5\ub2c8\ub2e4. \ud68c\uc758\uc2e4\uc5d0\uc11c\ub294 \ud558\uc774\ud2f0\uc758 \uc5ed\uc0ac, \ubb38\ud654 \ubc0f \uc804\ud1b5\uc5d0 \uad00\ud55c \uc18c\uac1c \uc138\uc158\uc774 \uc9c4\ud589\ub418\uc5c8\uace0, \uadf8\ub8f9\uc740 \ub300\uc0ac\uad00 \uc2dc\uc124\uc744 \uc548\ub0b4\ud558\ub294 \ub3d9\uc548 \ud5e4\uc5b4\uc84c\uc2b5\ub2c8\ub2e4.\n\n\uc774 \ubc29\ubb38\uc740 \ub300\uc0ac\uad00\uc758 \ubaa9\ud45c \uc911 \ud558\ub098\uc778 \ud558\uc774\ud2f0\uc758 \ubb38\ud654\uc801 \ubc0f \uc5ed\uc0ac\uc801 \uc7ac\uc0b0\uc744 \uc77c\ubcf8\uc758 \uc80a\uc740\uc774\ub4e4\uc5d0\uac8c \ud64d\ubcf4\ud558\ub294 \uc77c\ud658\uc785\ub2c8\ub2e4. \uc2e4\uc81c\ub85c \uc774\ub7ec\ud55c \uad50\ud658 \ubc0f \uacf5\uc720\uc758 \uae30\ud68c\ub294 \uc80a\uc740\uc774\ub4e4\uc774 \ub2e4\ub978 \ubb38\ud654\ub97c \ubc1c\uacac\ud558\uace0 \uc138\uacc4\uc5d0 \ub300\ud55c \uc2dc\uc57c\ub97c \ub113\ud788\ub294 \ub370 \uae30\uc5ec\ud569\ub2c8\ub2e4."},
