gmG(){return"\uc544\uc774\ud2f0 \ub300\uc0ac\uad00\uc740 \ube44\uc988\ub2c8\uc2a4 \uc678\uad50\uc758 \ud2b8\ub80c\ub4dc \uc138\ud130\ub85c \uc120\ub450\uc5d0 \uc11c \uc788\uc73c\uba70 \uc544\uc774\ud2f0\uc758 \ube44\uc988\ub2c8\uc2a4 \uac1c\ubc1c \uada4\ub3c4\ub97c \ub2e8\uc21c\ud788 \ucd09\uc9c4\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c \ubc00\uc5b4\uc62c\ub9ac\uae30 \uc704\ud574 \ub2e8\ud638\ud558\uac8c \ud5cc\uc2e0\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc6b0\ub9ac\uc758 \uc784\ubb34\ub294 \ub2e8\uc21c\ud788 \uaca9\ub824\ud558\ub294 \uac83\ubfd0\ub9cc \uc544\ub2c8\ub77c \uc9c0\uc18d \uac00\ub2a5\ud55c \uad00\uacc4\uc758 \ud655\ub9bd\uacfc \uac15\ud654\ub97c \ud1b5\ud574 \uacbd\uc81c \uc131\uc7a5\uacfc \uc77c\uc790\ub9ac \ucc3d\ucd9c\uc758 \ubcc0\ud601\uc801 \ud30c\ub3d9\uc744 \uc77c\uc73c\ud0a4\ub294 \uac83\uc785\ub2c8\ub2e4.\n\n \uc6b0\ub9ac \ub300\uc0ac\uad00 \ube44\uc804\uc758 \ud575\uc2ec\uc5d0\ub294 \uac15\ub825\ud55c \ubaa9\ud45c\uac00 \uc788\uc2b5\ub2c8\ub2e4. \uc544\uc774\ud2f0\ub85c \uc0c1\ub2f9\ud55c \uc678\uad6d \uc9c1\uc811 \ud22c\uc790\ub97c \uc720\uce58\ud558\uace0 \uc544\uc774\ud2f0 \ucc3d\uc758\uc131\uc5d0\uc11c \ud0c4\uc0dd\ud55c \ud0c1\uc6d4\ud55c \uc81c\ud488\uc744 \uc704\ud55c \uac1c\ubc29\uc801\uc778 \uc2dc\uc7a5\uc744 \ud3bc\uce58\uba70 \uc544\uc774\ud2f0 \uae30\uc5c5\uac00\uc640 \ube44\uc988\ub2c8\uc2a4\uc758 \ud3ec\ubd80\ub97c \uc5f4\uc815\uc801\uc73c\ub85c \uc639\ud638\ud558\ub294 \uac83\uc785\ub2c8\ub2e4. \uc774 \uc57c\uc2ec\ucc2c \ubbf8\uc158\uc740 \ub2e4\uc74c\uacfc \uac19\uc740 \uc5ed\ub3d9\uc801\uc774\uace0 \ub2e8\ud638\ud55c \ubc29\uc2dd\uc73c\ub85c \uc2e4\ud589\ub429\ub2c8\ub2e4: \n\n - \uc544\uc774\ud2f0\uc758 \uba85\ubc31\ud55c \ub9e4\ub825\uc744 \uc639\ud638: \uc6b0\ub9ac\ub294 \uc544\uc774\ud2f0\ub97c \ube44\ud560 \ub370 \uc5c6\uc774 \uc804\ub7b5\uc801\uc778 \ud22c\uc790 \ud5c8\ube0c\ub85c \ub2e8\uc5b8\ud558\uba70 \uc9c0\uc218\uc801 \uc131\uc7a5\uacfc \uc218\uc775\uc131 \uc788\ub294 \ube44\uc988\ub2c8\uc2a4 \uae30\ud68c\uc5d0 \ub300\ud55c \uadf8 \uc7a0\uc7ac\ub825\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n - \uc544\uc774\ud2f0\uc758 \ud0c1\uc6d4\ud55c \uc81c\ud488\uc744 \uc120\ubcf4\uc774\uae30: \uc6b0\ub9ac\ub294 \uc544\uc774\ud2f0\uc5d0\uc11c \uc81c\uc791\ub41c \ud2b9\ubcc4\ud55c \uc81c\ud488\uc744 \uc790\ub791\uc2a4\ub7fd\uac8c \uc120\ubcf4\uc774\uba70 \uc804\uc138\uacc4 \ubb34\ub300\uc5d0\uc11c \uadf8 \ub3c5\ud2b9\ud55c \ud2b9\uc9d5\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n - \ud1b5\ucc30\ub825 \uc788\ub294 \uc6cc\ud06c\uc0f5\uc744 \ud1b5\ud55c \uc790\uae30\uc804\ub825: \uc6b0\ub9ac\ub294 \ub2e8\uc21c\ud788 \uc9c8\ubb38\uc5d0 \ub2f5\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c \uc544\uc774\ud2f0\uc5d0\uc11c\uc758 \uc131\uacf5\uc744 \uc704\ud574 \ud22c\uc785\ub41c \uc7a0\uc7ac\uc801 \ud22c\uc790\uc790\ub4e4\uc5d0\uac8c \ud3ec\uad04\uc801\uc778 \ud1b5\ucc30\ub825\uc744 \uc81c\uacf5\ud558\uace0, \uadf8\ub4e4\uc774 \uc544\uc774\ud2f0\uc5d0\uc11c \uc131\uacf5\ud558\uae30 \uc704\ud574 \uc7a5\ube44\ub97c \uac16\ucd94\ub3c4\ub85d \ud558\ub294 \ub2e4\uc774\ub098\ubbf9\ud55c \uc6cc\ud06c\uc0f5\uc744 \uac1c\ucd5c\ud569\ub2c8\ub2e4. \n\n - \uc77c\ubcf8 \uc815\ubd80\uc640\uc758 \ud611\ub825 \uac15\ud654: \uc6b0\ub9ac\ub294 \uc77c\ubcf8 \uc815\ubd80\uc640 \uc801\uadf9\uc801\uc73c\ub85c \ud611\ub825\ud558\uc5ec \uc77c\ubcf8 \uc2dc\uc7a5\uc744 \ub113\uac8c \uac1c\ubc29\ud558\uace0 \uc544\uc774\ud2f0 \uc81c\ud488\uc758 \ud6cc\ub96d\ud568\uc744 \uc54c\ub9ac\uaca0\uc2b5\ub2c8\ub2e4. \n\n - \ud611\uc0c1\uc5d0\uc11c\uc758 \uc678\uad50\uc801 \ud0c1\uc6d4\ud568: \uc6b0\ub9ac\ub294 \uc678\uad50\uc801\uc73c\ub85c \ub2e4\ub978 \uad6d\uac00\ub4e4\uacfc \ud611\uc0c1\ud558\uba74\uc11c \uc911\uc694\ud55c \uc790\uc6d0\uc5d0 \uc811\uadfc\ud558\uace0 \ud6a8\uacfc\uc801\uc778 \ubb34\uc5ed \ud611\uc815\uc744 \uc131\ub9bd\ud558\uba70 \uac08\ub4f1 \uad00\ub9ac\uc640 \ubd84\uc7c1 \ud574\uacb0\uc744 \uc219\ub828\ub418\uac8c \ucc98\ub9ac\ud558\uba74\uc11c\ub3c4 \uc6b0\ub9ac \uace0\uad6d \ub300\ud45c\ub2e8\uc5d0 \uad73\uac74\ud55c \uc9c0\uc6d0\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4. \n\n - \ubd88\uad74\ud55c \uc639\ud638\uc640 \uc804\ub7b5\uc801 \uc704\uce58: \uc6b0\ub9ac\ub294 \uc804\ub7b5\uc801\uc778 \uc785\uc7a5\uc744 \ucde8\ud558\uace0 \uad6d\uc81c \uae30\uad6c \ub0b4\uc5d0\uc11c \ubb34\uc5ed \uc815\ucc45\uc744 \uc5f4\uc815\uc801\uc73c\ub85c \uc639\ud638\ud558\uba70 \ube44\uad77\uc9c0 \uc54a\ub294 \uacbd\uc81c\uc801 \ubc88\uc601\uc744 \ub2ec\uc131\ud558\uae30 \uc704\ud55c \ud655\uace0\ud55c \uc57d\uc18d\uc5d0 \uae30\ubc18\ud558\uc5ec \uc6c0\uc9c1\uc785\ub2c8\ub2e4. \n\n\n\n  \uc6b0\ub9ac\uc758 \ube44\uc988\ub2c8\uc2a4 \uc678\uad50 \ub178\ub825\uc758 \ud65c\ub825\uc5d0 \ubab0\uc785\ud558\uac70\ub098 \uc544\uc774\ud2f0\uc758 \uc720\ub9dd\ud55c \ubbf8\ub798\uc5d0 \ud22c\uc790\ud558\uac70\ub098, \uc6b0\ub9ac\uc758 \uac15\ub825\ud55c \uacbd\uc81c \ud65c\uc131\ud654 \uacc4\ud68d\uc5d0 \uae4a\uc740 \ud1b5\ucc30\uc744 \uc5bb\uace0 \uc2f6\ub2e4\uba74 amb.japon@diplomatie.ht\ub85c \uc774\uba54\uc77c\ub85c \uc5f0\ub77d\ud558\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4. \uc544\uc774\ud2f0\ub294 \ub2e8\uc21c\ud788 \ubaa9\uc801\uc9c0\uac00 \uc544\ub2cc, \uae00\ub85c\ubc8c \uc0c1\uac70\ub798\uc758 \uc9c0\ud615\uc744 \uc7ac\ud3b8\ud560 \uc900\ube44\uac00 \ub41c \ub3d9\uc801\uc778 \ud798\uc774\uba70, \uc5ec\ub7ec\ubd84\uc744 \uc774 \ubcc0\ud615\uc801\uc778 \uc5ec\uc815\uc758 \uc911\uc694\ud55c \uc77c\ubd80\ub85c \ucd08\ub300\ud569\ub2c8\ub2e4."},
