gmu(){return"\uce74\ub9ac\ube0c \ud574\uc5d0\uc11c \ub450 \ubc88\uc9f8\ub85c \ud070 \uc12c\uc73c\ub85c \ud3c9\uac00\ubc1b\ub294 \uc544\uc774\ud2f0\ub294 \ucfe0\ubc14\uc758 \ub3d9\ub0a8 77km\uc5d0 \uc704\uce58\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc544\uc774\ud2f0\ub294 \ub3c4\ubbf8\ub2c8\uce74 \uacf5\ud654\uad6d\uacfc \uacf5\uc720\ud558\ub294 \uc12c\uc758 \uc11c\ucabd \uc0bc\ubd84\uc758 \uc77c\uc744 \ucc28\uc9c0\ud558\uba70 1530km\uc5d0 \uc774\ub974\ub294 \uc6c5\uc7a5\ud55c \ud574\uc548\uc120\uc744 \uc790\ub791\ud569\ub2c8\ub2e4. \ubd81\ucabd \ub300\uc11c\uc591\uacfc \ub0a8\ucabd \uce74\ub9ac\ube0c \ud574 \uc0ac\uc774\uc758 \uc0b0\uc545 \uc9c0\ud615\uc744 \uc9c0\ubc30\ud558\ub294 \uc544\uc774\ud2f0\ub294 \ubcf8\ud1a0 \ubfd0\ub9cc \uc544\ub2c8\ub77c La Gon\xe2ve, La Tortue, \xcele-\xe0-Vache, La Navase \ub4f1 \uc5ec\ub7ec \uc12c\uc744 \ud3ec\ud568\ud55c \ud655\uc7a5\ub41c \uc9c0\uc5ed\uc744 \ubcf4\uc720\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4."},
